import React from 'react';
import PropTypes from 'prop-types';
import './DataCard.scss';

const DataCard = props => {
  const { data } = props;
  const cards = data.map(depart => {
    return (
      <button className="btn h-100 col col-11 col-lg-3 col-md-5 m-3 bg-white border data-card justify-content-left" >
          <div className="card-title">
            {depart.data.type}
          </div>
          <div className="card-body">
            <div> {depart.data.submittedDate}</div>
            <div> {depart.data.submittedDate}</div>
          </div>
      </button>
    );
  });
  // https://footprints-staging.hito.solutions/

  return <div className="row cards" onClick={props.handleAction}>{cards}</div>;
};

DataCard.propTypes = {
  data: PropTypes.array
};

DataCard.defaultProps = {
  data: []
};

export default DataCard;
